import React from 'react'
import dynamic from 'next/dynamic'


const MapSearch = dynamic(
    () => import('../component/custommap'),
    { ssr: false }
  )

const Map = () => (
    <MapSearch zoom={8} center={{ lat: 51.5287718, lng: -0.2416804 }} />
)

export default Map
